                <div className='container justify-content-center align-items-center'>
                    <Link to="../Pages/Contact_Us.js" ><h1>Contact With Us</h1></Link>
                    <p style={{color:'white'}}>created by <span>our team</span></p>
                    <p style={{color:'white'}}>&copy;2022 - <span>Bondy Inc</span></p>
                </div>
              

           </footer>
           </>
    );
};

